/**
 * Implements various KKBOX OAuth 2.0 authorization flows.
 */
export default class Auth {
    /**
     * Initialize the Auth object with client id and client secret.
     *
     * @param {string} client_id
     * @param {string} client_secret
     * @example new Auth(client_id, client_secret)
     */
    constructor(client_id, client_secret) {
        /**
         * @type {TokenFetcher}
         */
        this.tokenFetcher = new TokenFetcher(client_id, client_secret)

        /**
         * @type {ClientCredentialsFlow}
         */
        this.clientCredentialsFlow = new ClientCredentialsFlow(this.tokenFetcher)
    }
}

/**
 * Implements the client credentials flow. Used for accessing APIs that don't need any KKBOX
 * user's personal data.
 * @see https://kkbox.gelato.io/docs/versions/1.1/authentication
 */
export default class ClientCredentialsFlow {
    /**
     * @ignore
     */
    constructor(token) {
        /**
         * @ignore
         */
        this.token = token
    }

    /**
     * Fetch access token.
     *
     * @return {Promise}
     * @example auth.clientCredentialsFlow.fetchAccessToken()
     */
    fetchAccessToken() {
        return this.token.fetchAccessToken({grant_type: 'client_credentials'})
    }
}

import axios from 'axios'
import {authError} from '../catchError'
import querystring from 'querystring'
import {Token as ENDPOINT_TOKEN} from '../Endpoint'

/**
 * Fetches access token.
 */
export default class TokenFetcher {
    /**
     * @ignore
     */
    constructor(client_id, client_secret) {
        /**
         * @ignore
         */
        this.client_id = client_id

        /**
         * @ignore
         */
        this.client_secret = client_secret
    }

    /**
     * Fetches access token.
     *
     * @param {object} params - Form data.
     * @return {Promise}
     */
    fetchAccessToken(params) {
        return axios.post(ENDPOINT_TOKEN, querystring.stringify(params), {
            auth: {
                username: this.client_id,
                password: this.client_secret
            },
            headers: {'User-Agent': 'KKBOX JavaScript SDK'}
        }).catch(authError)
    }
}

/**
 * @ignore
 */
export const apiError = (error) => {
    if (error.response) {
        throw new Error(error.response.data.error.message)
    } else {
        throw new Error(error.message)
    }
}

/**
 * @ignore
 */
export const authError = (error) => {
    throw new Error(error.response.data.error)
}
